import React from 'react';
import { Link } from 'react-router-dom';

function Sidebar() {
    const menus = [
        { name: '로그인', path: '/' },
        { name: '새 글 작성', path: '/content' },
    ];

    return (
        <div className="sidebar">
            {menus.map((menu, index) => {
                return (
                    <Link to={menu.path} key={index}>
                        <SidebarItem menu={menu} />
                    </Link>
                );
            })}
        </div>
    );
}
export default Sidebar;
